import { Task } from '../model';
import { TaskItem } from 'TaskItem';

interface Props {
    tasks: Task[];
    setTasks: React.Dispatch<React.SetStateAction<Task[]>>;
}

export function TaskList({ tasks, setTasks }: Props) {

    return (
        <ul>
            {tasks.map((task) => {
                return <TaskItem {...task} key={task.id} />;
            })}
        </ul>
    );
}
